import React, { Component } from 'react';
import NavBar from './components/NavBar'
import './App.css';
import CoursesList from './components/CourseList';


class App extends Component {
  render() {
    return (
      <div>
        <NavBar />
        <CoursesList />
      </div>
    );
  }
}

export default App;
